  false,\n\t\"url\": null,\n\t\"notes\": \"This report, from the region 6 Wildlife
  Health Office, discusses management of bison (Bison bison) within the National Wildlife
  Refuge System, and future management issues and options.   Long-term bison conservation
  and genetic conservation may be achieved through metapopulation management of the
  bison.  Though not biologically significant for bison conservation, even very small
  bison herds may contribute to long-term conservation of bison through education
  and outreach efforts to the public thereby strengthening public support for refuges
  capable of supporting larger herds.  Research and techniques on bison genetics is
  discussed, along with possible management strategies.\",\n\t\"license_title\": \"License
